  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112252 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean from 1999-05-08 to 1999-05-30 and retrieved during cruise MR99-K02 and PACIFICA_49NZ19990508.
  These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include CTD, Coulometer for DIC
  measurement and bottle. These data were collected by Akihiko Murata, Andrey Andreev,
  Makio Honda and Yuichiro Kumamoto of Japan Agency for Marine-Earth Science and Technology
  (Jamstec) as part of the PACIFICA_49NZ19990508 data set.nnPACIFICA (PACIFic ocean
  Interior CArbon) was an international collaborative project for the data synthesis
  of ocean interior carbon and its related parameters in the Pacific Ocean. The North
  Pacific Marine Science Organization (PICES), Section of Carbon and Climate (S-CC)
  supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
